using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UIStoryboardPopoverSegue class defines a specific type of segue for presenting content in a popover. For popover segues, the destination view controller contains the content to be displayed in the popover. This class provides an additional popoverController property so that your custom code has access to the popover controller object. For example, you might want to store the popover controller elsewhere in your code so that you can dismiss the popover programmatically.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIStoryboardPopoverSegue_Class/index.html#//apple_ref/occ/cl/UIStoryboardPopoverSegue"/>    [iOSVersion(5)]    [Export("")]    public class UIStoryboardPopoverSegue : UIStoryboardSegue//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public UIStoryboardPopoverSegue() { }        /// <summary>        /// The popover controller used to display the destination view controller. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("popoverController")]        public UIPopoverController PopoverController { get; private set; }    }}